import React, { useEffect } from "react";
import { Carousel } from "react-responsive-carousel";
import frozenThird from "../../../images/Frozenfoods-third.jpg";
import frozenFourth from "../../../images/Frozenfoods-fourth.jpg";
import frozenFifth from "../../../images/Frozenfoods-fifth.jpg";
import { Link } from "react-router-dom";
import "./carsouelsection.css";
import axios from "axios";

function carsouelsection() {
  const monthNames = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];
  const currentMonth = monthNames[new Date().getMonth(1)];

  useEffect(() => {
    fetchAllProducts();
  }, []);


  const fetchAllProducts = async () => {
    try {
      const response = await axios.get('http://3.111.163.2:3129/api/product/getall');
      setAllProducts(response?.data?.data)
    } catch (error) {
      console.log('something went wrong', error)
    }
  }

  return (
    <div className="carsouelsection">
      <div className="hightlights-carousel container section">
        <h1 className="highlights-heading">Highlights of {currentMonth}</h1>
        <Carousel
          showArrows={true}
          infiniteLoop={true}
          showThumbs={false}
          showStatus={false}
          autoPlay={true}
          interval={3000}
          centerMode={true}
          centerSlidePercentage={33.33}
          showIndicators={false}
          renderArrowPrev={(onClickHandler, hasPrev, label) =>
            hasPrev && (
              <button
                type="button"
                className="carousel-arrow prev"
                onClick={onClickHandler}
                title={label}
              >
                &lt;
              </button>
            )
          }
          renderArrowNext={(onClickHandler, hasNext, label) =>
            hasNext && (
              <button
                type="button"
                className="carousel-arrow next"
                onClick={onClickHandler}
                title={label}
              >
                &gt;
              </button>
            )
          }
        >
          <Link to="/frozenfoodsCarousel">
            <div className="carousel-slide">
              <img className="carousel-img" src={frozenThird} alt="Product1" />
